import React from "react";
import "./Home.css";

const Accordian = () => {
  return (
    <div className="img-accordion">
      <div className="img Airplane">
        <p>UFV</p>
      </div>

      <div className="img DreamyBT">
        <p>BT Dreams</p>
      </div>

      <div className="img TheWindows">
        <p>Yellow</p>
      </div>

      <div className="img WilliamsburgBridge">
        <p>Williamsburg Bridge</p>
      </div>

      <div className="img NavyYardPlant">
        <p>Navy Yard</p>
      </div>

      <div className="img BrooklynTowerHD">
        <p>Brooklyn Tower</p>
      </div>
    </div>
  );
};

export default Accordian;
